import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import Footer from "./Footer";
import { createOwner } from "../services/api";
import "./owner.css";

export default function AddOwner() {
    const navigate = useNavigate();
    const [formData, setFormData] = useState({
        firstName: "",
        lastName: "",
        address: "",
        city: "",
        telephone: ""
    });
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const handleChange = (e) => {
        const { id, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        
        // Simple validation
        if (!formData.firstName || !formData.lastName || !formData.address || 
            !formData.city || !formData.telephone) {
            setError("All fields are required");
            return;
        }

        try {
            setLoading(true);
            setError(null);
            await createOwner(formData);
            navigate("/FindOwners"); // Redirect after successful creation
        } catch (err) {
            setError("Failed to create owner. Please try again.");
            console.error("Error creating owner:", err);
        } finally {
            setLoading(false);
        }
    };

    return (
        <>
            <Navbar />
            <div className="general">
                <div className="container">
                    <h1>Add New Owner</h1>

                    {error && (
                        <div className="alert alert-danger" role="alert">
                            {error}
                        </div>
                    )}

                    <form onSubmit={handleSubmit}>
                        <div className="mb-3">
                            <label htmlFor="firstName" className="form-label">First Name:</label>
                            <input
                                type="text"
                                id="firstName"
                                className="form-control text-hover-costem"
                                placeholder="First Name"
                                value={formData.firstName}
                                onChange={handleChange}
                            />
                        </div>

                        <div className="mb-3">
                            <label htmlFor="lastName" className="form-label">Last Name:</label>
                            <input
                                type="text"
                                id="lastName"
                                className="form-control text-hover-costem"
                                placeholder="Last Name"
                                value={formData.lastName}
                                onChange={handleChange}
                            />
                        </div>

                        <div className="mb-3">
                            <label htmlFor="address" className="form-label">Address:</label>
                            <input
                                type="text"
                                id="address"
                                className="form-control text-hover-costem"
                                placeholder="Address"
                                value={formData.address}
                                onChange={handleChange}
                            />
                        </div>

                        <div className="mb-3">
                            <label htmlFor="city" className="form-label">City:</label>
                            <input
                                type="text"
                                id="city"
                                className="form-control text-hover-costem"
                                placeholder="City"
                                value={formData.city}
                                onChange={handleChange}
                            />
                        </div>

                        <div className="mb-3">
                            <label htmlFor="telephone" className="form-label">Telephone:</label>
                            <input
                                type="text"
                                id="telephone"
                                className="form-control text-hover-costem"
                                placeholder="Telephone"
                                value={formData.telephone}
                                onChange={handleChange}
                            />
                        </div>

                        <button 
                            type="submit" 
                            className="btn-fowner"
                            disabled={loading}
                        >
                            {loading ? "Adding..." : "Add Owner"}
                        </button>
                    </form>
                </div>
            </div>
            <Footer />
        </>
    );
}
